function prechar(url, w, h) {
	var newImg = new Image(w, h)
	newImg.src = url

	newImg.onload = ()=>{
		console.log('Image charger dans la cache')
	}

	newImg.onerror = ()=>{
		console.log('erreur de chargement dans la cache')
	}
}

